import {Card} from 'antd';


const dummyInfo={
    storeTitle:'네도날드',
    storeAddress:'경기도 성남시 분당구 불정로 6 (우)13561',
    storeNumber:'1588-3830'
}

const StoreCardSum=()=>{
    return(
        <Card.Meta title={dummyInfo.storeTitle}
            description={dummyInfo.storeAddress}>
        </Card.Meta>
    )
}
export default StoreCardSum;
